import React, { useEffect, useState } from 'react';
import { Container, Divider } from '@material-ui/core';
import { PostRestaurant } from '../../components/post/postRestaurant';
import { postService } from './../../services/post.service';


export function Wiki(props) {
    const [dataPostRestaurant,setDataPostRestaurant]=useState([]);
    useEffect(() => {
        postService.getAllPost()
          .then(items => 
              {
                  console.log(items)
                setDataPostRestaurant(items.data.data.data)
              }
          ).catch(err=>console.log(err));
      }, []);
    return (
        <Container>
            <p>hiển thị các công thức nấu ăn, các nguyên liệu chế biến,... được đăng bởi các nhà hàng.</p>
            {
            dataPostRestaurant ? dataPostRestaurant.map((value) => {
              return <PostRestaurant value={value} key={value._id} ></PostRestaurant>;
            }) : null
          }
        </Container >
    );
}
